import React, { Fragment, Component } from 'react';

class Loaded extends Component {
  constructor(props) {
    super(props)

    this.handleChange = this.handleChange.bind(this);
  }

  handleChange(params) {
    this.setState({
      input: params.target.value
    })
  }

  render(props) {
    return (
      <Fragment>
        <h2>Hey</h2>
        <h2>{ props.name }, { props.state.text }</h2>
        <input placeholder={ props.state.placeholder } onChange={ (params) => this.handleChange(params) } />
        <button onClick={ props.onClick }></button>
      </Fragment>
    );
  }
}

export default Loaded;
